                            }

                            <Button endpoint={`/albums/${this.props.album._id}?_method=DELETE`} name={this.props.album.name} value="Delete" className="button"/>
                            </div>


                    </div>
                </div>

            </AppLayout>
        )
    }
}
module.exports = Show;

